import logo from './logo.svg';
import './App.css';
import {BrowserRouter as Router} from "react-router-dom";
import Navbar from './components/Navbar';

function App() {
  return (
    <div>
        <Router>
          <Navbar/>

          <switch>
              <Router exact path="/">
                H
              </Router>
              <Router path="/course">
                C
              </Router>
          </switch>
        </Router>
    </div>
  );
}

export default App;
